import React from "react";
import { Box, Grid, Typography } from "@mui/material";

const ImgCard = ({ card }) => {
  return (
    <Box
      sx={{
        width: "100%",
        position: "relative",
        borderRadius: "20px",
      }}
    >
      <img src={`${card.imageURL}`} alt="" width={420} height={310} />
      <Box

      >
        {card.ner}
      </Box>
    </Box>
  );
};
const Mainthree = () => {
  const coti = [
    {
      ner: "Beaches",
      imageURL: "./images/Beaches.svg",
    },
    {
      ner: "Deserts",
      imageURL: "./images/Deserts.svg",
    },
    {
      ner: "Mountains",
      imageURL: "./images/Mountains.svg",
    },
    {
        ner: "Iconic Cities",
        imageURL: "./images/IconicCity.svg",
    },
    {
        ner: "HouseBoats",
        imageURL: "./images/HouseBoats.svg",
    },
    {
        ner: "Countryside",
        imageURL: "./images/CountrySide.svg",
    },
    {
        ner: "Camping",
        imageURL: "./images/Camping.svg",
    },
    {
        ner: "Castles",
        imageURL: "./images/Castles.svg",
    },
    {
        ner: "Skiing",
        imageURL: "./images/Skiing.svg",
    },
    {
        ner: "Tropical",
        imageURL: "./images/Tropical.svg",
    },


  ];
  return (
    <Grid>
      <Typography
        variant="h4"    
        sx={{
          color: "white",
          fontWeight: "700",
          width: "900px",
          marginBottom: "2%",
        }}
      >
        Top Vacation Destinations
      </Typography>
      <Grid
        sx={{
          overflowX: "scroll",
          "&::-webkit-scrollbar": {
            display: "none",
          },
        }}
      >
        <Box sx={{ display: "flex", gap: "2% ", zIndex: "1" }}>
          {coti.map((card, index) => (
            <ImgCard key={index} card={card} />
          ))}
        </Box>
      </Grid>
    </Grid>
  );
};

export default Mainthree;
